import React from 'react'

const Middle = (props) => {
	return (
		<div
			style = {{height: '79.61vh', position: 'fixed', top: '12.39vh', width: '100%'}}
		>

		<div style = {{height: '90%', backgroundColor: 'purple'}}>

		</div>

		<h6>tab: {props.showTab}</h6>
		</div>
	)
}

export default Middle
